CREATE TABLE public."Drone" (
	"Id" INTEGER  PRIMARY KEY NOT NULL,
	"SerialNumber" CHARACTER VARYING(100)	NOT NULL,
	"Model" INTEGER NOT NULL,
	"WeightLimit" REAL NOT NULL,
	"BatteryCapacity" REAL NOT NULL,
	"State" INTEGER NOT NULL,
	"Weight" REAL NOT NULL DEFAULT 0
);
CREATE SEQUENCE public.Drone_Id_seq
    INCREMENT 1
    START 11
    MINVALUE 1
;
CREATE TABLE public."DroneLoad" (
	"Id" INTEGER PRIMARY KEY NOT NULL,
	"DroneId" INTEGER NOT NULL,
	"MedicationId" INTEGER NOT NULL
);
CREATE SEQUENCE Drone_Load_Id_seq
    INCREMENT 1
    START 2
    MINVALUE 1
;
CREATE TABLE public."Medication" (
	"Id" INTEGER  PRIMARY KEY NOT NULL,
	"Name" TEXT NOT NULL,
	"Weight" Real NOT NULL,
	"Code" CHARACTER VARYING(100) NOT NULL,
	"Image" TEXT NOT NULL
);
CREATE SEQUENCE Medication_Id_seq
    INCREMENT 1
    START 11
    MINVALUE 1
;
CREATE TABLE "__EFMigrationsHistory" (
	"MigrationId" CHARACTER VARYING(150) PRIMARY KEY NOT NULL,
	"ProductVersion" CHARACTER VARYING(32) NOT NULL
);

